/**
 * 页面名_模块名_类型名
 */
const indexState = {
    index_article_list: (action) => {
        return {
            default: {
                articleData: {}
            },
            type: 'testHandle',
            data: {
                index_article_list: {
                    articleData: action?action.data: {}
                }
            }
        }
    }
}

export default indexState;
